import React from "react";

const Contact = () => {
  document.title =
    "Contact Us | Luxury Silk Online, High Quality Hair Products. Nairobi, Kenya.";

  return (
    <div>
      <h1>Contact</h1>
    </div>
  );
};

export default Contact;
